    "Individualized Behavioral Health Monitoring Tool Project",nt"tracking_summary":
    {ntt"total": 6,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T00:47:20.945253",nt"name": "individualized-behavioral-health-monitoring-tool-project-54ce4",nt"isopen":
    true,nt"url": null,nt"notes": "Given the extended duration of future missions
    and the isolated, extreme and confined environments, there is the possibility that
    behavioral conditions and mental disorders (DSM-IV-TR) will develop. The overarching
    goal of this project is to deliver an Individualized Behavioral Health Monitoring
    Tool that unobtrusively integrates all available behavioral measures collected during
    a mission to provide a dashboard of behavioral health indicators. These indicators
    will be placed within the context of quantitatively-tracked mission stressors to
    provide meaningful feedback allowing behavioral issues to be detected and mitigated
    at an early stage. The result of this project will be a system prototype that can
    be deployed in space analog environments (e.g., Mars 520 study, Antarctica) for
    validation testing and ultimately deployed in long-duration space exploration missions.
    The critical need for an Individualized Behavioral Health Monitoring Tool has been
    identified as a priority outlined in the BHP Integrated Research Plan (July 2009)
    gap BMED3. Phase II will achieve: (1) an Individualized Behavioral Health Monitor
    software interface; (2) a data integration system; (3) a trend and change detection
    algorithm; and (4) a countermeasure selection aid. The Technology Readiness Level
    at the end of Phase II will be TRL 6.",nt"license_title": "U.S. Government
